import React from "react"

export default class Policy extends React.Component {

render(){
    return (
        <>
        <h4>
            Our COVID-19 Policy
        </h4>
        <p>
            Munch is committed to our users' health and safety. 
            We encourage all our Munchies to get the most up to date information on dining policies with the NYC Government.
            Please note: at this time, we are a NYC based app and can't advise on external policies. 
        </p>
        </>
    )
}}
